import React from "react";
import PropTypes from "prop-types";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

const App = (props) => {
  return (
    <div>
      <h1>App</h1>

      <Router>

        <Switch>
          <Route exact path="/">
          </Route>
          <Route path="/main">Main</Route>
          <Route path="/city">City</Route>
          <Route>Not Found</Route>
        </Switch>
      </Router>
    </div>
  );
};

App.propTypes = {};

export default App;
